import React from 'react';

import MapBe from '../components/MapBe'
import { Col, Row, Card } from 'react-bootstrap';


function Home() {
    return (
        <Card style={{ padding: '0px', margin: "0px" }}>
            <Row>
                <Col sm={8}><MapBe /></Col>
            </Row>
        </Card>
    );
}

export default Home;
